import React, { useEffect, useState } from 'react';

function App() {
	const [title, setTitle] = useState('Title!');

	useEffect(() => {
		console.log('render');
		setTitle('Updated po Effect');
	});

	const handleOnClick = () => {
		setTitle('Zmieniony div');
	};

	return (
		<div onClick={handleOnClick}>
			<h1>{title}</h1>
		</div>
	);
}

export default App;
